import React from 'react'
import './Navbar.css'
function Navbar(props)
{
    return (
        <>
           <div className="navbar"></div> 
           <nav>
                <span>ABOUT ME</span>
                <span>SERVICES</span>
                <span>P</span>
           </nav>
        </>
    )
}
export default Navbar
